//base
import React, { Fragment, useState, useEffect } from "react";

//material ui
//material ui
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import { createTheme, ThemeProvider, styled } from '@mui/material/styles';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import { Container, Typography } from "@mui/material";
import Divider from '@mui/material/Divider';
import { makeStyles } from '@mui/styles';
import TextField from '@mui/material/TextField';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import TablePagination from '@mui/material/TablePagination';
import LinearProgress from '@mui/material/LinearProgress';
import SearchBar from "material-ui-search-bar";
import SendIcon from '@mui/icons-material/Send';
import DeleteIcon from '@mui/icons-material/Delete';
import { confirmAlert } from "react-confirm-alert";
import "react-confirm-alert/src/react-confirm-alert.css";
import Snackbar from '@mui/material/Snackbar';
import MuiAlert from '@mui/material/Alert';
import EditIcon from '@mui/icons-material/Edit';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
        backgroundColor: theme.palette.common.black,
        color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
        fontSize: 14,
    },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
        border: 0,
    },
}));


const LogData = () => {
    return (
        <Fragment>
            <CssBaseline />
            <Grid container paddingTop={15} paddingLeft={10} >
                <Grid item xs={6} padding={5}>
                    <Paper elevation={3}>
                        <Box sx={{ minWidth: 275, bgcolor: '#f7f5f0' }}>
                            <CardContent>
                                <Grid container justifyContent="center" style={{ margin: 10 }} >
                                    <Grid item xs={2} justifyContent="center">

                                    </Grid>
                                    <Grid item xs={10} justifyContent="center">
                                        <TextField style={{ width: '80%' }} name="nama" label="Nama Lengkap" />
                                    </Grid>
                                </Grid>
                                <Grid container justifyContent="center" style={{ margin: 10 }}>
                                    <Grid item xs={2}>

                                    </Grid>
                                    <Grid item xs={10} justifyContent="center" >
                                        <TextField style={{ width: '80%' }} name="username" label="Username" />
                                    </Grid>
                                </Grid>
                                <Grid container justifyContent="center" style={{ margin: 10 }}>
                                    <Grid item xs={2}>

                                    </Grid>
                                    <Grid item xs={10} justifyContent="center">
                                        <TextField style={{ width: '80%' }} hintText="Password" name="password" type="password" label="Password" />
                                    </Grid>
                                </Grid>
                                <Grid container justifyContent="center" >
                                    <Button variant="contained" endIcon={<SendIcon />}>Simpan</Button>
                                </Grid>
                            </CardContent>
                        </Box>
                    </Paper>
                </Grid>
                <Grid item xs={6} padding={5}>
                    <Paper elevation={3}>
                        <Box sx={{ minWidth: 275, bgcolor: '#f7f5f0' }}>
                        <CardContent>
                            <TableContainer component={Paper} padding={10}>
                                <Table aria-label="customized table">
                                    <TableHead>
                                        <TableRow>
                                            <StyledTableCell style={{ width: '10vh' }} align="left">No</StyledTableCell>
                                            <StyledTableCell style={{ width: '20vh' }} align="left">Nama Lengkap</StyledTableCell>
                                            <StyledTableCell style={{ width: '20vh' }} align="left">Username</StyledTableCell>
                                            <StyledTableCell style={{ width: '20vh' }} align="left">Action</StyledTableCell>
                                        </TableRow>
                                    </TableHead>
                                    <TableBody>
                                        <StyledTableRow key="31">
                                            <StyledTableCell scope="row" style={{ width: '2px', height: "8px" }}>
                                                1
                                            </StyledTableCell>
                                            <StyledTableCell align="left" style={{ height: "8px", padding: "0px" }}>sadsa</StyledTableCell>
                                            <StyledTableCell align="left" style={{ height: "8px", padding: "0px" }}>ad</StyledTableCell>
                                            <StyledTableCell align="left" style={{ height: "8px", padding: "0px" }}><Button variant="contained" style={{ margin: '1rem', background: '#4CAF50' }} startIcon={<EditIcon />}>Edit</Button>
                                                <Button variant="contained" style={{ background: 'red' }} startIcon={<DeleteIcon />}>Delete</Button>
                                            </StyledTableCell>
                                        </StyledTableRow>
                                    </TableBody>
                                </Table>
                            </TableContainer>
                            </CardContent>
                        </Box>
                    </Paper>
                </Grid>
            </Grid>
        </Fragment>
    )
}

export default LogData;
